import { JoblyApi } from "./Api";

export const SearchBar = () => { 
    const Blankterm = "";
    const [term, setTerm] = useEffect(Blankterm);
    const handleChange = (e) => {
       setTerm(term)
    }
    return ( 
        <form>
            <input
                type="text"
                placeholder="Enter Search Term"
                onChange={handleChange}
                value={term}
                /> 
            <button> Submit </button>
        </form>
    )

}
